sys_variable_value.value:
(function execute(inputs, outputs) {

  var Response = false;

  var atualizarAuditoria = new TarefaAula_6();
  Response = atualizarAuditoria.atualizarAuditoria(inputs.parameter_nome,inputs.parameter_solicitacaoCredito,inputs.parameter_valorCredito,inputs.parameter_quantidade);

  outputs.parameter_response = Response;

})(inputs, outputs);

